import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';
import download from '../../../img/download.jpg';

const BookingItem = ({
  profile: {
    _id,
    owner,
    customer: { name },
    days,
    date,
    ownerFeedback,
    cusomterFeedback
  }
}) => {
  var feedback = 'no feedback';
  if (customer) {
    feedback = customer.feedback;
  }
  return (
    <div className='profile2 bg-light'>
      <div>
        <h4>Booking ID : {_id}</h4>
        <h6>
          {name} book the vehicle on{' '}
          {date && <span> {date.trim().split('T')[0]} </span>} for{' '}
          {days && <span> {days} </span>} days
        </h6>
        <h4>Feedback by {name}</h4>
        <h6>{ownerFeedback.feedback}</h6>

        {/* <p>{transmission}</p>
        <Link to={`/Bookings/${_id}`} className='btn btn-primary'>
          Bookings
        </Link> */}
      </div>
      {/* <ul>
        <li className='text-primary'>
          <i className='fas fa-address-book'></i>{' '}
          {avail && <span>{'Availaibility'}</span>}{' '}
        </li>
        <li className='text-primary'>
          <i className='fas fa-check'></i> {avail && <span>{avail}</span>}{' '}
        </li>
      </ul> */}
    </div>
  );
};

BookingItem.propTypes = {
  profile: PropTypes.object.isRequired
};

export default BookingItem;
